import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // Wait for the price filter container using its heading text (h4)
    await page.waitForSelector('text=Price Range', { timeout: 5000 });

    // Use XPath to find the price filter section (to use a different selector strategy)
    const [priceFilterSection] = await page.$x("//div[contains(@class, 'price-filter')]");
    if (!priceFilterSection) throw new Error('Price filter section not found');

    // Find the min and max price inputs by their placeholder attribute (different from previous attempts)
    const minInput = await priceFilterSection.$("input[placeholder='Min']");
    const maxInput = await priceFilterSection.$("input[placeholder='Max']");
    if (!minInput || !maxInput) throw new Error('Price range inputs not found');

    // Clear and enter new values
    await minInput.click({ clickCount: 3 });
    await minInput.fill('100');
    await maxInput.click({ clickCount: 3 });
    await maxInput.fill('500');

    // Take screenshot after filling price range
    const filledShot = path.join(screenshotsDir, 'step_2_filled_price_range.png');
    await page.screenshot({ path: filledShot });
    screenshots.push(filledShot);

    // Find and click the "Apply" button using its text content (different selector)
    const applyButton = await priceFilterSection.$("button:has-text('Apply')");
    if (!applyButton) throw new Error('Apply filter button not found');
    await applyButton.click();

    // Wait for a notification or UI update (look for notification class)
    await page.waitForSelector('.notification.success', { timeout: 5000 });

    // Take screenshot after applying filter
    const appliedShot = path.join(screenshotsDir, 'step_3_applied_filter.png');
    await page.screenshot({ path: appliedShot });
    screenshots.push(appliedShot);

    // Extract the applied price range from the input fields to verify
    const minValue = await minInput.inputValue();
    const maxValue = await maxInput.inputValue();

    // Extract the notification message
    const notification = await page.$('.notification.success');
    let notificationText = '';
    if (notification) {
      notificationText = await notification.textContent();
    }

    return {
      success: true,
      action: "Applied price range filter (100 to 500) using price filter UI",
      extractedData: {
        minPrice: minValue,
        maxPrice: maxValue,
        notification: notificationText.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
